var user_name;
var smelting_number;
var unit_num;
var part_name;
var comment;
var smelting_after_al_replace;
var al_clear_general;
var crystalisation_speed;
var S1;
var S2;
var S3;

user_name = msg.payload.user_name;
smelting_number = msg.payload.smelting_number;
unit_num = msg.payload.unit_num;
part_name = msg.payload.part_name;
comment = msg.payload.comment;
smelting_after_al_replace = msg.payload.smelting_after_al_replace;
al_clear_general = msg.payload.al_clear_general;
crystalisation_speed = msg.payload.crystalisation_speed;
S1 = msg.payload.S1;
S2 = msg.payload.S2;
S3 = msg.payload.S3;

var table_content = [
    {
        "user_name": user_name,
        "smelting_number": smelting_number,
        "unit_num": unit_num,
        "part_name": part_name,
        "comment": comment,
        "smelting_after_al_replace": smelting_after_al_replace,
        "al_clear_general": al_clear_general,
        "crystalisation_speed": crystalisation_speed,
        "S1": S1,
        "S2": S2,
        "S3": S3
    }
]

msg.payload = table_content;

return msg;

var pot_thermal_sensor = {};
var alloy_thermal_sensor = {};
var coolant_thermal_sensor = {};

pot_thermal_sensor.payload = msg.payload.pot_thermal_couple;
pot_thermal_sensor.topic = 'Температура в камере расплава';

alloy_thermal_sensor.payload = msg.payload.alloy_thermal_couple;
alloy_thermal_sensor.topic = 'Температура сплава';

coolant_thermal_sensor.payload = msg.payload.coolant_thermal_couple;
coolant_thermal_sensor.topic = 'Температура охладителя';

return [pot_thermal_sensor, 
        alloy_thermal_sensor, 
        coolant_thermal_sensor];

var status_code = 12;

if (msg.payload == status_code) {
    msg.payload = "Калибровка системы завершена";
    return msg;
}

