func:
msg.payload = [
    {
        command: "set_attribute",
        selector: "#roller_shutter",
        attributeName: "height",
        attributeValue: msg.payload
    },
    {
        command: "update_text",
        selector: "#LiquidLevel",
        textContent: "Liquid Level: " + String(msg.payload) + " L"
    }
]

return msg;

var valve_status_color;
var turn_status = msg.payload;

if ("Enabled" == turn_status) {
    valve_status_color = "green";
} else {
    valve_status_color = "red";
}

msg.payload = [
    {
        command: "update_text",
        selector: "#StatusText",
        textContent: msg.payload
    },
    {
        command: "update_attribute",
        selector: "#StatusTextFill",
        attributeName: "fill",
        attributeValue: valve_status_color
    },
    {
        command: "update_attribute",
        selector: "#ValveStatus",
        attributeName: "fill",
        attributeValue: valve_status_color
    }
]

return msg;

var cold_weld_temp = {};
var room_temp = {};

cold_weld_temp.payload = msg.payload.cold_weld_thermalcouple_sensor;
cold_weld_temp.topic = 'Температура холодного спая';

room_temp.payload = msg.payload.room_temp;
room_temp.topic = 'Температура в цеху';

return [cold_weld_temp, 
        room_temp];

var ppf_one = {};
var ppf_two = {};
var ppf_three = {};
var ppf_four = {};
var ppf_five = {};

ppf_one.payload = msg.payload.ppf_one_sensor;
ppf_one.topic = 'Температура ППФ 1';

ppf_two.payload = msg.payload.ppf_two_sensor;
ppf_two.topic = 'Температура ППФ 2';

ppf_three.payload = msg.payload.ppf_three_sensor;
ppf_three.topic = 'Температура ППФ 3';

ppf_four.payload = msg.payload.ppf_four_sensor;
ppf_four.topic = 'Температура ППФ 4';

ppf_five.payload = msg.payload.ppf_five_sensor;
ppf_five.topic = 'Температура ППФ 5';

return [ppf_one, 
        ppf_two,
        ppf_three,
        ppf_four,
        ppf_five];

